  useEffect(() => {
    const starryNight = () => {
      anime({
        targets: '.sky',
        translateX: 250
      }); 
    }

    starryNight();
  },[])

  return (
    <div className="sky">
      <h1>React App</h1>
    </div>
  );
}

export default App;
